import React from 'react';

const Chart = ({ chart }) => {
  // For simplicity, render the chart as an img with alt text
  return (
    <img
      src={chart}
      alt="7 day chart"
      style={{ width: '100px', height: '40px', objectFit: 'contain' }}
    />
  );
};

export default Chart;
